import React, { useEffect, useState } from "react";
import NavBar from "./NavBar";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import Spinner from "./Spinner";
import Alert from "./Alert";

const Partners = ({ partnerType }) => {
  const [partners, setPartners] = useState([]);
  const [loading, setLoading] = useState(false);
  const [alert, setAlert] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchPartners = async () => {
      setLoading(true);
      try {
        const response = await axios.get(`/partners`, {
          params: { partnerType },
        });
        setPartners(response.data);
        setAlert({ type: "success", message: "Partners loaded successfully." });
      } catch (error) {
        setAlert({ type: "danger", message: "Failed to load partners." });
        console.error(error);
      } finally {
        setLoading(false);
      }
    };

    fetchPartners();
  }, [partnerType]);

  const handleEditPartner = (partnerId) => {
    navigate(`/edit-partner?id=${partnerId}`);
  };

  const handleAddPartner = () => {
    navigate(`/add-partner`);
  };

  return (
    <div>
      <NavBar />
      <div className="container mt-4">
        {alert && <Alert type={alert.type} message={alert.message} />}
        {loading ? (
          <Spinner />
        ) : (
          <>
            <div className="d-flex justify-content-between mb-3">
              <h2>Partners</h2>
              <button
                onClick={handleAddPartner}
                className="btn btn-primary"
              >
                Add Partner
              </button>
            </div>

            <table className="table table-bordered">
              <thead>
                <tr>
                  <th>Full Name</th>
                  <th>Email</th>
                  <th>Contact No</th>
                  <th>Status</th>
                  <th>Opening Balance</th>
                  <th>Rep Name</th>
                  <th>Rep Contact</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {partners.length > 0 ? (
                  partners.map((partner) => (
                    <tr key={partner.id}>
                      <td>{partner.fullName}</td>
                      <td>{partner.email}</td>
                      <td>{partner.contactNo}</td>
                      <td>{partner.status}</td>
                      <td>{partner.openingBalance}</td>
                      <td>{partner.repName}</td>
                      <td>{partner.repContact}</td>
                      <td>
                        <button
                          onClick={() => handleEditPartner(partner.id)}
                          className="btn btn-success"
                        >
                          Edit
                        </button>
                      </td>
                    </tr>
                  ))
                ) : (
                  <tr>
                    <td colSpan="8" className="text-center">
                      No partners found.
                    </td>
                  </tr>
                )}
              </tbody>
            </table>
          </>
        )}
      </div>
    </div>
  );
};

export default Partners;
